/* eslint-disable no-unused-vars */
import React, { useEffect, useState } from 'react';
import Axios from 'axios'
import { BrowserRouter as Router, Switch, Route, Link, Redirect } from 'react-router-dom'
import MyNotes from './notes/MyNotes'
import Notes from './notes/Notes'
import AddNote from './notes/AddNote'
import { useHistory, useRouteMatch } from 'react-router';
import Navbar from './Navbar';

const Dashboard = () => {

    const [user, setUser] = useState("");
    // const [isLoggedIn, setIsLoggedIn] = useState(false)

    const url = "http://localhost:3002";
    const token = localStorage.getItem("token");
    let history = useHistory();

    const getUser = () => {
        Axios.get((url + "/auth"), {
            headers: {
                "token": `${token}`
            }
        }).then((response) => {
            // console.log("response", response)
            setUser(response)
        })
    }


    useEffect(() => {
        getUser();
    }, [])



    let match = useRouteMatch();

    return (
        <>
            <header className="header">
                <Navbar getUser={getUser} />
            </header>
            <Router>
                <div className="container-page">
                    <h2>Dashboard</h2>
                    <ul>
                        <li>
                            <Link to={`${match.url}/add-note`}>Add note</Link>
                        </li>
                        <li>
                            <Link to={`${match.url}/my-notes`}>My notes</Link>
                        </li>
                    </ul>

                    <div className="dashboard">
                        {/* <button onClick={addNote}>Add note</button>
                    <MyNotes />
                    <button onClick={allNotes}>all notes</button> */}

                        <Route exact path={`${match.path}/add-note`}>
                            <AddNote />
                        </Route>
                        <Route exact path={`${match.path}/my-notes`}>
                            <MyNotes />
                        </Route>
                        {/* <Route exact path="**"> */}
                        {/* <Redirect exact from="**" to="/dashboard" /> */}
                        {/* </Route> */}
                    </div>
                </div>
            </Router>
        </>
    )
}

export default Dashboard
